import React from 'react';


function Login() {
  return (
    <div className='login-container'>
      <img src='./assets/img/logo.png' alt='logo' width={603} height={164}></img>
      <img src='./assets/img/background.jpg' alt='background' width={1440} height={900}></img>
    </div>
  )
}

export default Login;
